import piazza from '../OneEvent/Piazza-Icon.png';
import canvas from '../OneEvent/canvas.png';
import plus from '../OneEvent/plus.png';
import handshake from '../OneEvent/handshake.png';
import gradescope from '../OneEvent/gradescope-icon.jpg';
import gmail from '../OneEvent/gmail.jpg';
import webreg from '../OneEvent/webreg.jpg';
import myTriLink from '../OneEvent/myTriLink.jpg';
import Podcast from '../OneEvent/podcast.jpg';
import Main from '../../routes/Main';

export const MainSquareMap = [
    {
        img: myTriLink,
        title: "My Triton Link",
        URL: "https://act.ucsd.edu/myTritonlink20/display.htm",
        More: "https://students.ucsd.edu/sponsor/new-students/before-arrive-freshmen.html"
    },
    {
        img: Podcast,
        title: "Podcast",
        URL: "https://podcast.ucsd.edu/",
        More: "https://podcast.ucsd.edu/howto.shtml"

    },
    {
        img: piazza,
        title: "Piazza",
        URL: "https://piazza.com",
        More: "https://www.youtube.com/watch?v=2jLSiN8E18w"
    },
    {
        img: gradescope,
        title: "Gradescope",
        URL: "https://www.gradescope.com",
        More: "https://www.youtube.com/watch?v=KMPoby5g_nE&feature=youtu.be"
    },
    {
        img: canvas,
        title: "Canvas",
        URL: "https://coursefinder.ucsd.edu",
        More: "https://www.instructure.com/canvas/"
    },
    
    {
        img: gmail,
        title: "Gmail",
        URL: "https://accounts.google.com/signin/v2/identifier?continue=https%3A%2F%2Fmail.google.com%2Fmail%2F&service=mail&sacu=1&rip=1&flowName=GlifWebSignIn&flowEntry=ServiceLogin",
        More: "https://google.com"
