        More: "https://students.ucsd.edu/academics/enroll/index.html"
    },
    
    {
        img: handshake,
        title: "HandShake(UCSD LINKIN)",
        URL: "https://ucsd.joinhandshake.com/login",
        More: "https://www.joinhandshake.com/students/how-it-works/"
